  false,\n\t\"url\": null,\n\t\"notes\": \"This GIS grid atlas contains precipitation
  frequency estimates for the Ohio River Basin and Surrounding states is based on
  precipitation data collected between 4/1863-12/2000. This atlas is an updated version
  of Technical Memorandum NWS Hydro 35, Five to 60-minutes Precipitation Frequency
  for Eastern and Central United States (1977), Technical Paper 40 - Rainfall Frequency
  Atlas of the United States for Durations from 30 minutes to 24 hours and Return
  Periods from 1 to 100 Years (1961) and Technical Paper 49 - Two-to-Ten-Day Precipitation
  for Return Periods of 2 to 100 Years in the Contiguous United States (1964) for
  the following states: Delaware, District of Columbia, Illinois, Indiana, Kentucky,
  Maryland, New Jersey, North Carolina, Ohio, Pennsylvania, South Carolina, Tennessee,
  Virginia and West Virginia. The grids provide information for durations from 5 minutes
  through 60 days, and for return periods of 2 years through 1000 years.\",\n\t\"license_title\":
